import "./styles.scss";
import PageDown from "../../Components/PageDown"

const Education= ({ view, home }) => {
  return (
    <article id="education">
      <div id="ccp-badge" class="badge" />
      <PageDown view = { view } menu = { menu } />
    </article>
  )
}

export default Education
